import { Fragment } from "react";
import styles from "./styles.module.scss";
import ClosetCard from "./card";

const closets = [
    {_id: 1, img: "", desc: "Default Closet 1"},
    {_id: 2, img: "", desc: "Default Closet 2"},
    {_id: 3, img: "", desc: "Default Closet 3"},
];

const Closets = ({}) => {
    return(
        <Fragment>
            <div className={styles.cardContainer}>
                {closets.map(c => (
                    <ClosetCard closet={c}/>
                ))
                }
            </div>
        </Fragment>
    );
};

export default Closets;
